import React from 'react'
import Table from '../src/components/Table'
import { useState } from '@storybook/addons'

export default {
  title: 'Example/Table',
  component: Table,
}

const Template = (args) => {
  const [index, setIndex] = useState(null)
  return (
    <Table
      {...args}
      indexRowOpened={index}
      onRowClick={(indexRow) => {
        if (index === indexRow) {
          setIndex(null)
        } else {
          setIndex(indexRow)
        }
      }}
    />
  )
}

